import "../Style/SignUp.css";

function SignUp() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>회원가입</h1>
        <Link to="/">
          <button className="back-button-HomePage">뒤로 가기</button>
        </Link>
      </header>
    </div>
  );
}

export default SignUp;
